import { createWebHistory, createRouter } from "vue-router";
import Home from "@/views/Home.vue";
import AppAbout from "@/views/About.vue";

const routes = [
  {
    path: "/",
    name: "Home",
    component: Home,
  },
  {
    path: "/about",
    name: "AppAbout",
    component: AppAbout,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
